if (!deps) {
    return '';
}
var order = deps['order'];
delete deps['order'];
if (order)
    order = _.union(order, Object.keys(deps));
else
    order = Object.keys(deps);
var head = [];
order.forEach(function(dep) {
    var depFiles = _.union(cms.deps[dep], deps[dep]);;
    head.push(cms.functions.processDep(dep, depFiles));
});

return head;
